import React from 'react';
import './Post.css';

export default function Post(props) {
  return (
    <div className="post">
      <h1>{props.name}</h1>
      <br />
      <p>{props.price}</p>
      <br />
      <button
        style={{ width: "50px", height: "50px" }}
        onClick={() => {props.deletePost();}}
      >
        X
      </button>
    </div>
  );
}
